import { Typography } from "@mui/material";
import React from "react";
import { Box } from "@mui/system";
import TextField from '@mui/material/TextField';
import TextareaAutosize from '@mui/material/TextareaAutosize';


function AddressDetails(){
    return(
        <Box sx={{
            display:'flex',
            flexDirection:'column',
            width:'60vw',
            border:'1px solid red',
            height:450,
            justifyContent:'space-between'


        }}>
            <Box sx={{
            display:'flex',
            flexDirection:'row',
            justifyContent:'space-around',
            width:'100%'}}>
            <Typography sx={{position:'relative',right:200}}>Customer Details</Typography>
            <Typography sx={{border:'1px solid black',position:'relative',left:200}}>Address Details</Typography>
            </Box>


            <Box sx={{
            display:'flex',
            flexDirection:'column',
            width:'100%',
            height:400,
            border:'1px solid black',justifyContent:'space-between',alignItems:'center'

                }}>
                    <Box sx={{
                        display:'flex',
                        justifyContent:'space-around',
                        width:'100%'

                    }}>
                            <TextField id="outlined-basic" label="firstname" variant="outlined" sx={{width:'50%'}} />
                            <TextField id="outlined-basic" label="lastname" variant="outlined" sx={{width:'50%'}} />
                            </Box>
                           <TextareaAutosize
                            aria-label="minimum height"
                            minRows={3}
                            placeholder="Minimum 3 rows"
                            style={{ width: '60%' }}
                          />



                    <Box sx={{
                        display:'flex'
                    }}></Box>

                    <Box sx={{
                        display:'flex'
                    }}></Box>

            </Box>

        </Box>
    )


}
export default AddressDetails
